class Solution:
    def containsCycle(self, grid: list[list[str]]) -> bool:
        n,m=len(grid),len(grid[0])
        print(n,m)
        vis_main=[[0]*(m) for _ in range(n)]
        def dfs(i,j,pi,pj,vis):
            vis_main[i][j]=1
            print("Function Callled",i,j)
            if(vis[i][j]==1):
                return 0
            else:
                vis[i][j]=1
                res=float('-inf')
                for x,y in [[-1,0],[1,0],[0,-1],[0,1]]:
                    print("Gonna Call",i+x,j+y,pi,pj,"for",i,j)
                    if((i+x!=pi or j+y!=pj) and i+x>=0 and i+x<n and j+y>=0 and j+y<m and grid[i+x][j+y]==grid[i][j]):
                        res=max(res,1+dfs(i+x,j+y,i,j,vis))
                return res
        for i in range(n):
            for j in range(m):
                if(vis_main[i][j]==0):
                    # vis_main[i][j]=1
                    vis=[[0]*(m) for _ in range(n)]
                    v=dfs(i,j,-1,-1,vis)
                    print("Got",i,j,v)
                    if(v>=4):
                        return True
        return False
         

